import React from 'react'
import { PopularData } from './Totaldata'

const Popular = () => {
  return (
    <div className='container'>
      <div className='row'>
        <div className='top-head'>
          <p>Popular Apartment in Mysuru</p>
        </div>
        {PopularData.map(()=>(
          <div></div>
        ))}
      </div>
    </div>
  )
}

export default Popular
